def dispatch_to_series(left, right, func, str_rep=None, axis=None):
    import pandas as pd

    if isinstance(right, str) and right == "NaT":
        right = pd.NaT
    right = pd.to_timedelta(right)

    if isinstance(right, pd.Timedelta):
        new_data = left.apply(lambda col: func(col, right))
    elif isinstance(right, pd.DataFrame):
        assert right.index.equals(left.index)
        assert right.columns.equals(left.columns)
        new_data = left.apply(lambda col: func(col, right[col.name]))
    elif isinstance(right, pd.Series):
        if axis == "columns":
            assert right.index.equals(left.columns)
            new_data = left.apply(lambda col: func(col, right.loc[left.columns]))
        else:
            assert right.index.equals(left.index)
            new_data = left.apply(lambda col: func(col, right))
    else:
        raise NotImplementedError(right)

    return new_data
